// SPDX-License-Identifier: MIT
// An example of a consumer contract that relies on a subscription for funding.
pragma solidity ^0.8.7;
import "@openzeppelin/contracts/access/Ownable.sol";
import "./chainlinkv0.8/VRFCoordinatorV2Interface.sol";
import "./chainlinkv0.8/VRFConsumerBaseV2.sol";

import "../IDDS.sol";

uint256 constant FOEVER = type(uint256).max;

contract VRFGenerator is VRFConsumerBaseV2, Ownable {
    event RequestSent(uint256 requestId, uint32 numWords);
    event RequestFulfilled(uint256 requestId, uint256[] randomWords);

    struct RequestStatus {
        bool fulfilled; // whether the request has been successfully fulfilled
        bool exists; // whether a requestId exists
        address owner; // the caller to make the request
        uint256[] randomWords;
    }
    mapping(uint256 => RequestStatus) s_requests; /* requestId --> requestStatus */
    VRFCoordinatorV2Interface COORDINATOR;

    // past requests Id.
    uint256[] public requestIds;
    uint256 public lastRequestId;

    // Depends on the number of requested values that you want sent to the
    // fulfillRandomWords() function. Storing each word costs about 20,000 gas,
    // so 100,000 is a safe default for this example contract. Test and adjust
    // this limit based on the network that you select, the size of the request,
    // and the processing of the callback request in the fulfillRandomWords()
    // function.
    uint32 callbackGasLimit = 100000;

    // The default is 3, but you can set this higher.
    uint16 requestConfirmations = 3;

    mapping(address => uint256) operators;

    modifier onlyOperator() {
        require(
            msg.sender == owner() ||
                operators[msg.sender] == 0 ||
                operators[msg.sender] > block.timestamp,
            "Operator Not Valid Or Expired"
        );
        _;
    }

    /**
     * COORDINATOR: Stored in DDS based on chain
     */
    constructor() VRFConsumerBaseV2(getCoordinator()) {
        COORDINATOR = VRFCoordinatorV2Interface(getCoordinator());
    }

    function getCoordinator() internal view returns (address) {
        IDDS dds = IDDS(BEE_DDS_ADDRESS);
        return dds.toAddress(dds.get("ISOTOP", "COORDINATOR"));
    }

    function getSubID() internal view returns (uint64) {
        IDDS dds = IDDS(BEE_DDS_ADDRESS);
        return uint64(dds.toInt(dds.get("ISOTOP", "SubscriptionID")));
    }

    function getKeyHash() internal view returns (bytes32) {
        IDDS dds = IDDS(BEE_DDS_ADDRESS);
        return bytes32(dds.get("ISOTOP", "KEY_HASH_WEI"));
    }

    function setOperator(address _to, uint256 expireDate) external onlyOwner {
        operators[_to] = expireDate;
    }

    function reset() external onlyOwner {
        selfdestruct(payable(owner()));
    }

    // Assumes the subscription is funded sufficiently.
    function requestRandomWords(uint32 numWords)
        external
        onlyOperator
        returns (uint256 requestId)
    {
        if (getSubID() == 0) return 0;

        // Will revert if subscription is not set and funded.
        requestId = COORDINATOR.requestRandomWords(
            getKeyHash(),
            getSubID(),
            requestConfirmations,
            callbackGasLimit,
            numWords
        );
        s_requests[requestId] = RequestStatus({
            randomWords: new uint256[](0),
            exists: true,
            owner: msg.sender,
            fulfilled: false
        });
        requestIds.push(requestId);
        lastRequestId = requestId;
        emit RequestSent(requestId, numWords);
        return requestId;
    }

    function fulfillRandomWords(
        uint256 _requestId,
        uint256[] memory _randomWords
    ) internal override {
        require(s_requests[_requestId].exists, "request not found");
        s_requests[_requestId].fulfilled = true;
        s_requests[_requestId].randomWords = _randomWords;
        emit RequestFulfilled(_requestId, _randomWords);
    }

    function getRequestStatus(uint256 _requestId)
        external
        view
        returns (bool fulfilled, uint256[] memory randomWords)
    {
        require(s_requests[_requestId].exists, "request not found");
        require(s_requests[_requestId].owner == msg.sender, "only owner");
        RequestStatus memory request = s_requests[_requestId];
        return (request.fulfilled, request.randomWords);
    }

    function shuffle(uint256 size, uint256 entropy)
        external
        pure
        returns (uint256[] memory)
    {
        uint256[] memory result = new uint256[](size);

        // Initialize array.
        for (uint256 i = 0; i < size; i++) {
            result[i] = i;
        }

        // Set the initial randomness based on the provided entropy.
        bytes32 random = keccak256(abi.encodePacked(entropy));

        // Set the last item of the array which will be swapped.
        uint256 last_item = size - 1;

        // We need to do `size - 1` iterations to completely shuffle the array.
        for (uint256 i = 1; i < size - 1; i++) {
            // Select a number based on the randomness.
            uint256 selected_item = uint256(random) % last_item;

            // Swap items `selected_item <> last_item`.
            uint256 aux = result[last_item];
            result[last_item] = result[selected_item];
            result[selected_item] = aux;

            // Decrease the size of the possible shuffle
            // to preserve the already shuffled items.
            // The already shuffled items are at the end of the array.
            last_item--;

            // Generate new randomness.
            random = keccak256(abi.encodePacked(random));
        }

        return result;
    }

    function shuffle16(uint16 size, uint256 entropy)
        external
        pure
        returns (uint16[] memory)
    {
        uint16[] memory result = new uint16[](size);

        // Initialize array.
        for (uint16 i = 0; i < size; i++) {
            result[i] = i;
        }

        // Set the initial randomness based on the provided entropy.
        bytes32 random = keccak256(abi.encodePacked(entropy));

        // Set the last item of the array which will be swapped.
        uint256 last_item = size - 1;

        // We need to do `size - 1` iterations to completely shuffle the array.
        for (uint16 i = 1; i < size - 1; i++) {
            // Select a number based on the randomness.
            uint16 selected_item = uint16(uint256(random) % last_item);

            // Swap items `selected_item <> last_item`.
            uint16 aux = result[last_item];
            result[last_item] = result[selected_item];
            result[selected_item] = aux;

            // Decrease the size of the possible shuffle
            // to preserve the already shuffled items.
            // The already shuffled items are at the end of the array.
            last_item--;

            // Generate new randomness.
            random = keccak256(abi.encodePacked(random));
        }

        return result;
    }
}
